INSERT INTO `reviews` VALUES (58099,'A Star Is Born (2018)','It will be nominated for several Oscars and win best original song for sure.Whether you love Gaga as a singer or not let\'s just appreciate and enjoy this amazing work by a new actress LadyGaga.','8.3'),(58100,'Border (2018)','This is undoubtedly one of the strangest films I\'ve ever seen and although I cannot fault Border for being an original and striking piece I can\'t say that it\'s the most enthralling film ever made either.It\'s a unique idea that the film pushes forward with confidence and persistence and it definitely makes Border a striking watch throughout.However while it\'s an interesting and equally confusing film from the start Border hits a little bit of a roadblock about halfway through as it runs out of su','6.9'),(58102,'Can You Ever Forgive Me? (2018)','Richard E. Grant for Best Actor or Best Supporting Actor! He made this good film better and with amazing physical acting and by inserting a huge dose of humanity. Melissa McCarthy is always high quality and an eternally underappreciated Jane Curtain seals the package.I found the film very engrossing and it kept my attention','7.6'),(58103,'Cathy\'s Curse (1977)','Even though this film is cheesey and uber-low budget it\'s not too bad. Although many of the scenes are more than shades of The Exorcist Omen Carrie and The Fury there are some unique moments that gave me the shivers (such as the snake-and-rats scene and when Cathy appears and disappears before her mother on the steps). ','4.2'),(58104,'Halloween (2018)','I don\'t understand the hate for this film or why is it so bad? I went too see this movie In the movie theater last night with my eyes and my mind open which I had blast watching the film. It is gory it is bloody with real horror slasher effects.','7.1'),(58105,'Mid90s (2018)','Sure it might not be the most original take on the coming-of-age story (Jonah Hill even admitted it is a movie built on tropes) but what makes it unique is the chemistry and exuberance shared between the 5 boys. It\'s also irreverent AF which feels incredibly refreshing.','7.7'),(58106,'Suspiria (2018)','Set in the German Autumn of 1977 the movie tries to confront the supernatural horror of Suspira with the earthly horror of the RAF terror. But like the psychoanalyst Dr. Klemperer (Tilda Swindon) who is not able to help his patient Patricia the director fails to give some analytical insight in the nature of horror itself','8.4'),(58108,'Dr. Seuss\' The Grinch (2018)','Very plain script. No added humor to the main story and characters whatsoever as one might expect from illumination. Couldnt wait to exit the theater. My kids barely sat through it.','6.3'),(58109,'Nobody\'s Fool (2018)','Finally people are realizing Tiffany Haddish is not funny. Even on the poster she is over acting with that silly looking expression.','4.5'),(58110,'Overlord (2018)','If you want to go in to watching this film without seeing the trailer then don\'t read any reviews - including this one. ','7.2'),(58111,'Fantastic Beasts: The Crimes of Grindelwald (2018)','Completely filled with plots subplots mostly for nothing... Almost similar to the first part filled with story... Doesn\'t contain that typical Harry Potter magic but contains elements from it!!!Didn\'t contain any big plot twist!!! Just considering it as an episode of a series setting up for the next episode!!!','8.2'),(58112,'Goosebumps 2: Haunted Halloween (2018)','Good movie','7.8'),(58113,'Johnny English Strikes Again (2018)','After being in a premiere and seeing Rowan as Johnny is spectacular and I would definitely say that it is a great movie for both kids and adults with everything we love in it.10/10 you\'ve outdone yourself again Johnny by entertaining us all.','6.6'),(58114,'Night School (2018)Interesting','6.8',''),(58115,'Restoring Tomorrow (2016)','A well-constructed and intensely personal introspective into the restoration of both an historic building and the lifeblood of a community.','8.6'),(58116,'Smallfoot (2018)','Very bad','3.4'),(58117,'The Girl in the Spider\'s Web: A New Dragon Tattoo Story (2018)','Sad horrible','5'),(58118,'The Nutcracker and the Four Realms (2018)','Copeland provides a perfect example of why some classics shouldn\'t be messed with even when you think you have something fresh to contribute. The film attempts to upend your expectations of the story but each and every revelation or twist falls completely flat.','5.6'),(58119,'Trabajo Sucio (2018)','Trabajo Sucio is a social message that resonates with modern Dominican Society because it expertly paints its characters inside a world of greed and corruption that is prejuidice to outsiders and those less fortunate of us. Taking the audience on an adventure filled with mystery and intrigue that climaxes on an unexpected and very suprising note. Highly recommended for the whole family as the issues presented in this film are morals worth learning for all ages and social classes. Truely worth it','8.4'),(58120,'Venom (2018)','Don\'t listen to the critics whom are desperately trying to remain relevant in a time where the opinion of the audience truly matters.The movie is geniunely good. What it isn\'t is fantastic however.-buildup. The intro of the movie was fine. Nothing spectacular but certainly progressed the story into the right direction. Though it did linger on for a tad bit too long.-The plot while amusing is definitely lacking and drops the ball at least at a certain point which i cant really dive into here due ','8/107'),(58121,'Boy Erased (2018)','As a gay man myself this movie made me sooooo angry. Not because it wasn\'t made well but it brought everything back up to the surface that I thought I was past. From growing up religious and believing that there was something wrong with him to the conversations he has with his father... It was like watching my life in a movie. Anyways I highly recommend this movie it\'s difficult to watch but it shows the reality that so many of us go through and are afraid to tell anyone.','6.9'),(58122,'Crazy Rich Asians (2018)','Comedy','6.7'),(58123,'First Man (2018)','First Man is a historical biographical drama film based on the life of astronaut Neil Armstrong directed by Damien Chazelle (Whiplash La La Land). Starring Ryan Gosling in the lead role it paints a beautifully told and respectable portrait of the famous astronaut\'s life and the significance of his contribution to human history.In the 1960s the space race between the USA and the USSR is at its peak with the latter having a clear lead over the former.','7.7'),(58124,'Free Solo (2018)','Ok. ok ok...I know what you are going to say but Larren this isn\'t a horror movie.But as my brother Dude would say...I say Nay Nay.If you haven\'t seen it go see and tell me it isn\'t a horror movie. In every sense of the way I was uncomfortable the entire time.','8.7'),(58125,'The Hate U Give (2018)','Beautiful thought-provoking well-crafted gem-thank you to everyone involved in making this wonderful film. Although this film is a message movie it\'s not one told through narrow-minded tunnel vision I think the author (Angie Thomas) of the book that this film is based on understands the frustrating fact that some of the worst issues that need fixing have no quick and easy solutions and are complex and take time for the human mind to understand (especially to the minds of those who aren\'t being a','7.1'),(58127,'Beautiful Boy (2018)','A difficult one.Well I\'m not the guy that gets upset because every little thing and I really wanted to like the movie but Beautiful Boy has definitely a few faults.Firstly the editing (especially in the first half) is very confusing. The flashbacks are so mixed up it\'s hard to understand. ','7.3');
